description:
Автомобиль в отличном состоянии, дополнительный вложений не требует, своевременно пройдены все ТО. В наличии два комплекта ключей и сервисная книжка. Проведена полная предпродажная подготовка, а так же химчистка салона. Комплект зимних шин в подарок. Аргументированный торг при осмотре автомобиля – приветствуется!

Все автомобили, представленные в продаже, проходят тщательную проверку по более 30 параметрам. Предоставляем гарантию юридической чистоты, а так же год технической гарантии на двигатель и КПП в письменной форме. Бесплатный тест-драйв. Возможно оформление автомобиля в кредит!

Преимущества автокредитования:
— Первоначальный взнос от 0%;
— Более 28 кредитных программ;
— Срок кредита от 6 месяцев до 5 лет;
— Процентная ставка от 9% годовых;
— Оформление кредита по двум документам;
— Сумма кредита от 60 000 до 1 000 000 рублей;
— Досрочное погашение без штрафов и комиссий;
— Оформление КАСКО – по желанию;
— Без справок и поручителей.

Сотрудничаем с 12 аккредитованными и сертифицированными банками РФ, среднее время ожидания решения банка 20–30 минут.

При покупке автомобиля по программе «Trade-in – выгодный обмен» или в кредит, получите гарантированную скидку до 50 000 рублей на данный автомобиль! Всем покупателям комплект зимней резины и шиномонтаж в подарок!

Бесплатный трансфер до автосалона от ст. м. Кузьминки.

Записаться на тест-драйв, а так же получить подробную информацию можно у специалистов автоцентра по указанному номеру телефона.

